GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_01"] = [[$16021371]] -- - Command Unit (Secondary). Detects Infiltrators.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_02"] = [[$16021372]] -- - Very powerful psyker in terminator armour, with a will of iron and unfailing resolve.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_03"] = [[$16021373]] -- - Equipped with a mastercraft storm-bolter and a force staff.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_04"] = [[$16021374]] -- - Has exceptionally keen senses and unparalleled sight radius.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_05"] = [[$16021375]] -- - He uses his psychic powers to support his Battle-Brothers on the battlefield.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_06"] = [[$16021376]] -- - By accessing ancient tomes from the Librarium, he gains varied sets of powers!
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_07"] = [[$16021377]] -- - Can use his teleporters to access remote or unreachable locales on the map.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_08"] = [[$16021378]] -- - Effective against most units, very effective against Daemons in close combat.
